import React from "react";
import './App.css';
import Header from "./Header";
import Home from "./Home"
import { BrowserRouter as Routes, Route, BrowserRouter } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <div className="app">
        <Routes>
          <Route path="/" element={<Header/>}>
            <Home/>
          </Route>
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
